import React, { useState } from "react";
import CreateRecipe from "../components/new_recipe";

const Create = (props) => {
    const [recipeList, setRecipeList] = useState([]);

    return (
        <div>
            <CreateRecipe
                recipeList={recipeList}
                setRecipeList={setRecipeList}
            />
        </div>
    );
};

export default Main;
